import { Col, Row } from "react-bootstrap";
import Logo from "../assets/imgs/Navbarlogo.png";
import Nav from 'react-bootstrap/Nav';
import '../assets/css/Footer.css'
function Footer() {
    return (
        <>

            <div className="footer"></div>

            <Row className="footer">
                <Col className="ccccol-1">
                    <img src={Logo} alt="IBA" />

                </Col>
            </Row>

            <Row>
                <Col className="ccccol-2">
                    <Nav.Link href="#deets" style={{ marginRight: '20px', color: 'white' }}>Web3Maker</Nav.Link>
                    <Nav.Link href="#features" style={{ marginRight: '20px', color: 'white' }}>White paper</Nav.Link>
                    <Nav.Link href="#pricing" style={{ marginRight: '20px', color: 'white' }}>Services</Nav.Link>
                    <Nav.Link href="#pricing" style={{ marginRight: '20px', color: 'white' }}>Tool</Nav.Link>
                    <Nav.Link href="#pricing" style={{ marginRight: '20px', color: 'white' }}>Contact Us</Nav.Link>

                </Col>
            </Row>


        </>
    );

}

export default Footer;
